import React, { Component } from 'react';

class YouTubeComp extends Component {
    render() {
        // const options = {
        //     height: '390',
        //     width: '640',
        //     playerVars: {
        //         autoplay: 0,
        //     },
        // };

        return (
            <div>
                <iframe
                    src={this.props.vidSource}
                ></iframe>
            </div>
        );
    }
}

export default YouTubeComp;
